import { useState } from "react";
import { useEffect } from "react";
import { useParams } from "react-router-dom";



const Details = () => {
    const { id } = useParams();
    const [product, setProduct] = useState([]);

    // console.log(id)
    useEffect(() => {
        fetch("http://localhost:9000/shop/details/")
            .then(response => response.json())
            .then(productObj => console.log(productObj))

    }, [])
    if (product) return (
        <div>

            {Object.keys(product)
                // .filter((elt) => elt.id === id)
                .map((elt, index) => (
                    <div key={index}>
                        <h2>{elt._id}</h2>
                        <h2>{elt.ProductName}</h2>
                    </div>
                ))}
        </div >
    )
    else return (<h1>Loading...</h1>)
}

export default Details
